import {
  AfterViewInit,
  ChangeDetectionStrategy,
  Component,
  ElementRef,
  HostBinding,
  Inject,
  Input,
  OnInit,
  Optional,
  Renderer2,
  ViewEncapsulation,
} from '@angular/core';
import { SelectComponent, UI_SELECT } from './select.component';

@Component({
  selector: 'ui-option',
  exportAs: 'uiOption',
  templateUrl: './option.component.html',
  styleUrls: ['./option.component.scss'],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class OptionComponent implements AfterViewInit, OnInit {
  @HostBinding('class') cssClass: string = 'ui-option';

  @Input() value: unknown;
  @Input() disabled: boolean = false;

  @Input()
  get selected(): boolean {
    return this._selected;
  }
  set selected(value: boolean) {
    if (this._selected !== value) {
      this._selected = value;
      if (this._select) {
        this._select.value = this.value;
      }
    }
  }
  private _selected: boolean = false;

  private _select: SelectComponent;

  constructor(
    @Optional() @Inject(UI_SELECT) select: SelectComponent,
    private elementRef: ElementRef,
    private renderer: Renderer2,
  ) {
    this._select = select;
  }

  ngOnInit(): void {
    if (this._select && this._select.value === this.value) {
      this.selected = true;
    }
  }

  ngAfterViewInit(): void {
    const hostElement = this.elementRef.nativeElement as HTMLElement;
    const parent = this.renderer.parentNode(hostElement) as HTMLElement;

    while (hostElement.firstChild) {
      this.renderer.appendChild(parent, hostElement.firstChild);
    }
    this.renderer.removeChild(parent, hostElement, true);
  }
}

import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  EventEmitter,
  HostBinding,
  Inject,
  Input,
  OnInit,
  Optional,
  Output,
  ViewEncapsulation,
} from '@angular/core';
import { RadioGroupDirective, UI_RADIO_GROUP } from './radio-group.directive';

let nextUniqueId = 0;

@Component({
  selector: 'ui-radio-button',
  exportAs: 'uiRadioButton',
  templateUrl: './radio-button.component.html',
  styleUrls: ['./radio-button.component.scss'],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class RadioButtonComponent implements OnInit {
  @HostBinding('class') cssClass: string = 'ui-radio-button';

  private _uniqueId: string = `ui-checkbox-${++nextUniqueId}`;

  @Input()
  @HostBinding('attr.id')
  id: string = this._uniqueId;

  get inputId(): string {
    return `${this.id || this._uniqueId}-input`;
  }

  @Input() name: string | undefined;

  @Input()
  get checked(): boolean {
    return this._checked;
  }
  set checked(newCheckedValue: boolean) {
    if (this._checked !== newCheckedValue) {
      this._checked = newCheckedValue;
      if (this._radioGroup) {
        const isSelected: boolean = this._radioGroup.value === this.value;
        if (newCheckedValue && !isSelected) {
          this._radioGroup.selected = this;
        } else if (!newCheckedValue && isSelected) {
          this._radioGroup.selected = null;
        }
      }
    }
    this._changeDetectorRef.markForCheck();
  }
  private _checked: boolean = false;

  @Input()
  get value(): unknown {
    return this._value;
  }
  set value(newValue: unknown) {
    if (this._value !== newValue) {
      this._value = newValue;
      if (this._radioGroup) {
        if (!this.checked) {
          this.checked = this._radioGroup.value === newValue;
        }
        if (this.checked) {
          this._radioGroup.selected = this;
        }
      }
    }
  }
  private _value: unknown = null;

  @Input()
  get disabled(): boolean {
    return this._disabled || this._radioGroup?.disabled;
  }
  set disabled(newDisabledValue: boolean) {
    if (this._disabled !== newDisabledValue) {
      this._disabled = newDisabledValue;
      this._changeDetectorRef.markForCheck();
    }
  }
  private _disabled: boolean = false;

  @Input()
  get required(): boolean {
    return this._required || this._radioGroup?.required;
  }
  set required(newRequiredValue: boolean) {
    if (this._required !== newRequiredValue) {
      this._required = newRequiredValue;
      this._changeDetectorRef.markForCheck();
    }
  }
  private _required: boolean = false;

  @Output() readonly change: EventEmitter<unknown> = new EventEmitter<unknown>();

  private _radioGroup: RadioGroupDirective;

  constructor(
    @Optional() @Inject(UI_RADIO_GROUP) radioGroup: RadioGroupDirective,
    private _changeDetectorRef: ChangeDetectorRef,
  ) {
    this._radioGroup = radioGroup;
  }

  ngOnInit(): void {
    if (this._radioGroup) {
      this.checked = this._radioGroup.value === this.value;
      if (this.checked) {
        this._radioGroup.selected = this;
      }
      this.name = this._radioGroup.name;
    }
  }

  markForCheck(): void {
    this._changeDetectorRef.markForCheck();
  }

  onChange(event: Event): void {
    event.stopPropagation();
  }

  onInputClick(event: Event): void {
    event.stopPropagation();

    if (!this.checked && !this.disabled) {
      this.checked = true;
      this.change.emit(this.value);

      if (this._radioGroup) {
        this._radioGroup._controlValueAccessorChangeFn(this.value);

        const groupValueChanged = this.value !== this._radioGroup.value;
        if (groupValueChanged) {
          this._radioGroup.change.emit(this._radioGroup.value);
        }
      }
    }
  }
}

import {
  ChangeDetectionStrategy,
  ChangeDetectorRef,
  Component,
  ElementRef,
  EventEmitter,
  forwardRef,
  HostBinding,
  InjectionToken,
  Input,
  Output,
  Provider,
  ViewChild,
  ViewEncapsulation,
} from '@angular/core';
import { ControlValueAccessor, NG_VALUE_ACCESSOR } from '@angular/forms';

export const UI_SELECT = new InjectionToken<SelectComponent>('SelectComponent');

export const UI_SELECT_CONTROL_VALUE_ACCESSOR: Provider = {
  provide: NG_VALUE_ACCESSOR,
  useExisting: forwardRef(() => SelectComponent),
  multi: true,
};

@Component({
  selector: 'ui-select',
  exportAs: 'uiSelect',
  templateUrl: './select.component.html',
  styleUrls: ['./select.component.scss'],
  providers: [UI_SELECT_CONTROL_VALUE_ACCESSOR, { provide: UI_SELECT, useExisting: SelectComponent }],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class SelectComponent implements ControlValueAccessor {
  @HostBinding('class') cssClass: string = 'ui-select';

  @Input()
  get value(): unknown {
    return this._value;
  }
  set value(newValue: unknown) {
    if (this._value !== newValue) {
      this._value = newValue;
      this._controlValueAccessorChangeFn(this.value);
    }
  }
  private _value: unknown;

  @Input() required: boolean = false;
  @Input() disabled: boolean = false;

  @ViewChild('select') selectElementRef!: ElementRef;

  _controlValueAccessorChangeFn: (value: unknown) => void = () => {};

  _onTouched: () => unknown = () => {};

  @Output() readonly selectionChange: EventEmitter<unknown> = new EventEmitter<unknown>();

  constructor(private _changeDetectorRef: ChangeDetectorRef) {}

  onChange(): void {
    const selectNativeElement = this.selectElementRef.nativeElement as HTMLSelectElement;
    this.value = selectNativeElement.value;
    this.selectionChange.emit(this.value);
    this._changeDetectorRef.markForCheck();
  }

  writeValue(value: unknown): void {
    this.value = value;
    this._changeDetectorRef.markForCheck();
  }

  registerOnChange(fn: (value: unknown) => void): void {
    this._controlValueAccessorChangeFn = fn;
  }

  registerOnTouched(fn: () => unknown): void {
    this._onTouched = fn;
  }

  setDisabledState(isDisabled: boolean): void {
    this.disabled = isDisabled;
    this._changeDetectorRef.markForCheck();
  }
}

